    sortProps(props, alreadyChosen) {
        const rankedProps = {};
        for (const prop in props) {
            if (alreadyChosen.indexOf(prop) > -1) {
                rankedProps[prop] = 20;
            }
            else if (prop in this.highlyHumanReadable) {
                rankedProps[prop] = this.highlyHumanReadable[prop];
            }
            else if (prop.startsWith("child")) {
                rankedProps[prop] = 6;
            }
            else if (prop.startsWith("lastChild")) {
                rankedProps[prop] = 5;
            }
            else {
                rankedProps[prop] = 0;
            }
        }
        return Object.keys(rankedProps).sort((a, b) => rankedProps[b] - rankedProps[a]);
    }
